Serviço: PR_ADM_EMAIL.

begin
      --M2 inicio
      select descrip
        into P_URL_BASE
        from lval
       where tipolval = 'URLEMAIL'
         and codlval = '1';
      --M2 fim
      --P_URL_BASE:='http://srvprtapp001d/portalcliente/downloadBoleto?token='; --M2
      P_TITULO := 'numeroTitulo='||cNumtitulo;
      P_IDEPOL := 'idepol='||nIdepol;
      P_AUX := P_TITULO || '&' || P_IDEPOL;
      --
      RetVal := ADMTMS.GERACHAVESTORAGE ( P_AUX );
      vLinkTitulo := P_URL_BASE||RetVal;
    exception
      when others then
        cMsgErro := 'Obtendo URL:'||substr(sqlerrm,1,200);
        raise eSaidaForcada;
    end;
